export default ({ label }) => {
	return (
		<div class='py-2'>
			<h4 class='uppercase text-sm font-semibold pb-2 text-gray-800'>{label}</h4>
			<label for={`${label}`}></label>
			<input type='text' id={`${label}`} class='' placeholder='' />
		</div>
	);
};
